@import 'predefinied.scss';

.header {
    position: fixed;
    z-index: 1024;
    width: 100%;
    display: flex;
    top: 0;
    transition: $durationM;
    flex-direction: column;
    padding: 0;

    &.scrolled {
        background: white;
        box-shadow: 0 0 20px 0px rgba(134, 134, 134, 0.5);
    }

    &__container-upper {
        height: 105px;
        position: relative;
        background: transparent;
        border-radius: .0010px;
        transition: $durationM;

        // &.scrolled {
        //     box-shadow: 0 20px 35px rgba(0, 0, 0, 0.2);
        //     margin-top: 0.25rem;
        //     border-radius: 200px;
        //     background: white;
        //     padding: 0 0.75rem;


        //     .header__logo-container {
        //         margin-left: 1rem;
        //     }
        // }
    }

    &__logo {
        max-width: 250px;
        max-height: 100%;
        position: relative;
        z-index: 10;

        &-container {
            font-size: $fontSizeH3;
            display: flex;
            align-items: center;
            font-weight: bold;
            color: $dark !important;

            &.opacity0 {
                opacity: 0;
            }

            svg {
                margin-top: -4px;
            }

            sup {
                font-size: $fontSizeBodyXSS;
                margin-top: -1rem;
            }
        }
    }


    .nav-toggle {
        z-index: 1024;
        display: none;
        background: none;
        border: 0;
        outline: 0;
        height: 48px;
        align-items: center;

        // background: white;
        justify-content: center;
        align-items: center;
        position: relative;
        transition: $durationM;
        // box-shadow: 4px 4px 8px $neuShadow1,
        //     -4px -4px 8px $neuShadow2;


        &:active {
            transform: scale(0.9);
        }

        &.white {
            svg path {
                fill: white;
            }
        }

        svg {
            // color: $pirateBlack;
            transition: $bezierFastoutSlowin 0.5s;
            top: 50%;
            left: 50%;
            position: absolute;
            width: 28px;
            height: 28px;
            z-index: 1;




            path {
                // fill: white;
                transition: $bezierFastoutSlowin 0.5s;
            }
        }

        &__inner {
            position: relative;
        }

        &__icon--menu {
            opacity: 1;
            transform: translate(-50%, -50%);
        }

        &__icon--close {
            opacity: 0;
            transform: translate(-50%, -50%) rotate(45deg);
        }
    }

    .button-icon-only {
        align-items: center;
        justify-content: center;
        padding: 0;
    }

    &__nav {
        flex-grow: 10;
    }

    &__search {
        &-input {
            border: none;
            background: transparent;
            // color: white;
            font-size: $fontSizeBodyXS;
            font-family: 'Kelson-Sans-RU', sans-serif;
            padding-bottom: 0;
            line-height: 0.9;
            transition: $durationM;

            overflow: hidden;
            outline: none;
            box-shadow: none;
            width: 170px;
            padding-left: 0.5rem;
            padding-right: .25rem;

            &.tt-hint {
                padding: 0 0.5rem !important;
            }

            &::placeholder {
                // color: white;
                color: $dark;
            }

        }

        &-submit {
            margin-left: -2px;
            transition: $durationM;

            svg path {
                fill: $dark;
                transition: $durationM;
            }

            &:hover {
                transform: scale(1.2);
                outline: none;
                box-shadow: none;

                svg path {
                    fill: $yellow-dark;
                }
            }

            &:active {
                transform: scale(0.9);
                outline: none;
                box-shadow: none;
            }
        }

        &-form {
            display: inline-flex;
            align-items: center;
            box-shadow: $regularShadow;
            border-radius: 200px;
            background: white;

            width: 230px;
            padding-left: 0.5rem;
            transition: $durationM;
            justify-content: space-between;
            padding: 0.75rem 1rem;

            .form-control.tt-input {
                border-radius: 200px;
                margin-right: 0.5rem;
            }
        }
    }

    &__cart-container,
    &__login-container {
        display: flex;
        align-items: center;
        justify-content: center;
        position: relative;
        padding: 0 1rem;

        .cart__btn,
        .login__btn {

            svg,
            svg path {
                transition: $durationM;
            }

            &:hover {
                svg {
                    transforM: scale(1.2);
                }

                svg path {
                    fill: $yellow;
                }
            }

            &:active {
                svg {
                    transform: scale(0.9);
                }
            }
        }

        .cart,
        .login {
            position: absolute;
            right: .5rem;
            top: 70px;
            border-radius: 1.5rem;
            background: white;
            width: 340px;
            box-shadow: $regularShadow;
            opacity: 0;
            transition: $durationM;
            z-index: 2;

            .card-body {
                // background: white;
            }

            &.collapsing {
                opacity: 1;
            }

            &.show {
                opacity: 1;

                .login__go-btn,
                .cart__go-btn {
                    bottom: -31px;
                    opacity: 1;
                }
            }

            &__item {
                display: flex;

                &-img {
                    border-radius: 0.4rem;
                    max-width: 40px;
                    max-height: 40px;
                    object-fit: contain;
                    object-position: center;
                    align-self: center;
                    margin: auto;

                }

                &-content {
                    flex-grow: 10;
                    display: flex;
                    justify-content: start;
                    align-items: center;
                    margin: 0.5rem 0 0.5rem 1rem;
                    flex-wrap: wrap;
                }

                &-name {
                    font-weight: bold;
                    flex-basis: 100%;
                    color: $grey-5;
                }

                &-amount {

                    .plus,
                    .minus {
                        margin-top: -1px;

                        svg,
                        svg path {
                            transition: $durationS;
                        }

                        &:hover {
                            svg path {
                                fill: black;
                            }
                        }

                        &:active {
                            transform: scale(0.8);
                        }
                    }
                }

                &-amount-number,
                &-price {
                    font-weight: bold;
                }
            }

            &__go-btn {
                // transition-timing-function: linear;
                opacity: 0;
                position: absolute;
                bottom: 0;
                right: 1.5rem;
            }
        }

        .login {
            &__p {
                a {
                    text-decoration: underline;
                    font-weight: bold;
                }
            }
        }
    }

    &__nav-upper-list {
        list-style-type: none;
        list-style: none;
        display: flex;
        align-items: center;
        margin-bottom: 0;
        padding-left: 1rem;

        .header {
            &__nav-li {
                padding: 0 1rem;
                font-weight: bold;
            }

            &__nav-link {
                &:hover {
                    color: $yellow-dark;
                }
            }
        }
    }

    &__nav-link {
        // color: white;
        font-size: $fontSizeBodyS;
        text-decoration: none;
        position: relative;
        transition: color $durationS ease .1s;
        line-height: 1;
        border-radius: 0;
        letter-spacing: $spaceLetters;
        transition: $bezierFastoutSlowin 0.36s;

        &:active,
        &:hover {
            text-decoration: none;
            // color: white;

            &:before {
                width: 100%;
            }
        }

        &.active {
            // color: white;
        }
    }

    &__nav-bottom {
        display: flex;
        justify-content: space-around;
        list-style: none;
        list-style-type: none;
        padding: 0;
        width: 100%;
        position: relative;



        &-li:hover>.mega-menu,
        &-li .mega-menu:hover {
            opacity: 1;
            display: flex;
        }


        &-li:hover>.header__nav-link {
            color: white;
            z-index: 3;

            svg path {
                fill: $yellow-dark;
                z-index: 3;
            }

            span,
            svg {
                z-index: 3;
            }

            &::after {
                opacity: 1;
                display: block;
                z-index: 2;
            }
        }

        &-li.no-menu:hover>.header__nav-link {
            &::after {
                height: 48px;
                top: -13px;
                border-radius: 1rem;
            }
        }

        &-link {
            font-weight: bold;
            position: relative;
            transition: 0s;
            display: flex;
            align-items: center;

            span,
            svg {
                position: relative;
                z-index: 1;
                transition: 0s;
                margin: 0 0.25rem;
            }

            &::after {
                content: '';
                top: -1rem;
                left: -1rem;
                border-top-left-radius: 1rem;
                border-top-right-radius: 1rem;
                width: calc(100% + 2rem);
                height: calc(100% + 3rem);
                background: #3F3F3F;
                position: absolute;
                // opacity: 0;
                display: none;
            }
        }

        &-mega-menu {
            position: absolute;
            left: -1rem;
            padding: 3rem 2rem;
            background: #3f3f3f;
            color: white;
            width: calc(100% + 4rem);
            border-radius: 20px;
            top: 2.5rem;
            display: flex;
            justify-content: space-between;
            display: none;
            // transition: $durationXS;
            // opacity: 0;

            a {
                color: white;

                &:hover {
                    color: $yellow-dark;
                }

                &.active {
                    color: $yellow-dark;
                    font-weight: bold;
                }
            }

            .sizeOf {
                margin-right: 1.5rem;
            }

            .mega-menu {

                &__colors-sizes,
                &__categories-container,
                &__new-products {
                    max-width: 100%;
                    min-width: 230px;
                    display: inline-block;
                }

                &__categories-container {
                    min-width: 350px;
                }

                &__new-products {
                    min-width: 480px;
                    max-width: 485px;

                    .owl-dots {
                        bottom: initial;
                        top: -40px;
                    }
                }

                &__banner-container {
                    max-width: 100%;
                    max-height: 300px;
                    margin-bottom: 1.5rem;

                    .owl-stage-outer,
                    .owl-stage,
                    .owl-item {
                        height: 100%;
                    }

                    .owl-dots {
                        bottom: -50px;
                    }
                }

                &__banner-link {
                    display: block;
                    height: 100%;
                    width: 100%;
                }

                &__banner {
                    object-fit: cover;
                    height: 100%;
                    object-position: center;
                    max-height: 300px;
                    min-height: 200px;
                    border-radius: 1.25rem;
                }

                &__grid {
                    display: grid;
                    grid-template-columns: repeat(auto-fill, minmax(220px, 230px));
                    gap: 0.25rem;
                    grid-auto-flow: dense;
                }

                &__product-img {
                    width: 54px;
                    max-width: 54px;
                    height: 54px;
                    margin-right: 0.5rem;
                    object-fit: contain;
                    border-radius: 1rem;
                    padding: 0.25rem;
                    background: $light;
                }

                &__product-content {
                    font-size: $fontSizeBodyXS;
                }


            }


            .owl-dots {
                position: absolute;
                width: 100%;
                bottom: -40px;
                display: flex;
                align-items: center;
                justify-content: center;

                .owl-dot {
                    background: darken($color: $dark, $amount: 10%);
                    height: 22px;
                    width: 22px;
                    margin: 0.5rem;
                    border-radius: 50%;
                    position: relative;

                    &::after {
                        content: '';
                        height: 12px;
                        width: 12px;
                        top: 50%;
                        left: 50%;
                        transform: translate(-50%, -50%);
                        position: absolute;
                        opacity: 0;
                        transition: $durationM;
                        background: $yellow-dark;
                        border-radius: 50%;
                        z-index: 2;
                    }

                    &.active {
                        &::after {
                            opacity: 1;
                        }
                    }
                }
            }

        }
    }

    &__dropdown-close {
        opacity: 1;
        position: absolute;
        left: 1rem;
        cursor: pointer;
    }

}

@media (max-width:1327px) {
    .header__nav-bottom-mega-menu {

        .mega-menu {

            &__colors-sizes,
            &__categories-container,
            &__new-products,
            &__banner-container {
                width: calc(50% - 3rem);
            }

            &__categories-container,
            &__banner-container {
                margin-right: 0 !important;

            }

            &__banner-container,
            &__new-products {
                .owl-dots {
                    bottom: -40px;
                    top: initial;
                }
            }

            &__banner-container {
                margin-bottom: 0 !important;
            }
        }
    }
}

@media (max-width: 480px) {
    .header {
        &__nav-bottom-mega-menu {
            .mega-menu {
                &__new-products {
                    .owl-dots {
                        bottom: -30px;
                    }
                }
            }
        }


        &__logo {
            max-width: 230px;
        }
    }


}

@media (max-width: 992px) {
    .header {
        &__nav-bottom {
            position: initial;
            border-radius: 0;
        }

        &__container-bottom {
            height: auto;
        }

        &__nav-bottom-mega-menu {
            width: calc(100% - -0.1rem);
            left: 0.9rem;
            z-index: 3;
            top: 0;
            border-radius: 0;
            height: 100%;
            overflow: auto;
            overflow-x: hidden;
            padding-top: 4rem;

            .mega-menu {
                &__new-products {
                    max-width: 100%;
                    width: 100%;
                    min-width: initial;

                }

                &__banner-container {
                    max-width: 100%;
                    width: 100%;
                    margin-top: 2rem;
                }
            }
        }

        &__search {
            &-input {
                border: none;
                outline: none;
                box-shadow: none;
                width: 170px;
                padding-left: 0.5rem;
            }
        }
    }


    .header {
        bottom: initial;
        top: 0;
        width: 100%;
        padding: 0;
        height: 70px;
        max-width: 100vw;
        left: 0;


        &.navbar .container-fluid {
            justify-content: space-between;
        }

        .container-fluid {
            margin-top: 0;
            padding: 0;
            min-height: initial;
            height: 60px;

            &.scrolled {
                background: white;

                .header__lang-all {
                    top: initial;
                    width: auto;

                    .container {
                        margin: 0;
                    }
                }
            }
        }


        &__logo {
            padding: 0;


            &-container {
                padding: 0.5rem 1rem;
                position: relative;
                z-index: 10;

                svg {
                    height: 40px;
                    width: auto;
                }
            }
        }

        &__nav {
            position: fixed;
            top: 0;
            right: 0;
            bottom: 0;
            left: 0;
            background: rgba(255, 255, 255, 0.9);
            backdrop-filter: blur(2px);
            transform: translate(0, -100%);
            transition-duration: $durationL;
            transition-timing-function: $bezierFastoutSlowin;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: flex-start;
            padding-top: 70px;
            max-width: 100%;
            width: 100%;
            opacity: 0;
            margin: 0;


            &--entered {
                transform: translateZ(0) translateY(0);
                opacity: 1;
            }

            &-upper,
            &-upper-list {
                flex-direction: column;
                width: 100%;
                left: 0;
                top: 0;
                margin-top: 0;
                padding-left: 0;

                &-functions {
                    justify-content: center;
                }
            }

            &-bottom {
                flex-direction: column;
            }

        }

        &__nav-list {
            transform: none;
            display: block;
            flex-direction: initial;
        }

        &__nav-link {
            width: 100%;
            display: block !important;
            font-size: $fontSizeBodyL;
            padding: 16px;
            text-align: center;
            margin: 0;
        }

        .nav-toggle {
            display: flex;
            margin-right: 0;
            width: 48px;
            height: 48px;
            border-radius: 50%;

            &__inner {
                width: 32px;
                height: 32px;
            }

            &--entered {
                .nav-toggle__icon--menu {
                    opacity: 0;
                    transform: translate(-10%, -50%);
                }

                .nav-toggle__icon--close {
                    opacity: 1;
                    transform: translate(-50%, -50%) rotate(0);
                }
            }
        }

        &__cart-container,
        &__login-container {
            position: initial;
        }
    }

}

@media (min-width:1400px) {
    .header__nav-bottom-mega-menu {
        left: 1rem;
        width: 100%;
    }
}

@media (min-width:1792px) {
    .header__logo-container {
        margin-left: -92px;
    }
}







//fixes for system
.tt-scrollable-menu .tt-menu {
    border-radius: 1rem;
    border-top-left-radius: 0;
    border: none;
    margin-top: 6px;
    border-top-right-radius: 0;
    box-shadow: 0px 8px 9px rgba(0, 0, 0, 0.15);
}



.tt-scrollable-menu .tt-menu {
    overflow-x: hidden;

    .tt-suggestion {
        text-overflow: ellipsis;
        overflow: hidden;
        white-space: nowrap;
    }

    .tt-selectable {
        cursor: pointer;

        &:hover {
            cursor: pointer;
        }
    }
}

sources.styles\\style.scss:
// @import 'predefinied.scss';
@import 'header.scss';
// @import url('bootstrap/dist/css/bootstrap.min.css');
// @import url('owl.carousel/dist/assets/owl.carousel.css');
// @import url('animate.css/source/animate.css');

// @import url('select2/dist/css/select2.min.css');


body {
    font-family: 'Kelson-Sans-RU', sans-serif;
    color: $dark;
    overflow-x: hidden;
    width: 100%;
}

.popup {
    position: fixed;
    bottom: 1rem;
    right: 150%;
    width: 100%;
    max-width: 300px;
    background: white;
    border-radius: 1.5rem;
    border: 1px solid $yellow;
    padding: 1.5rem;
    z-index: 9999;
    transition: $durationM;
    box-shadow: $regularShadow;

    &.bg-yellow {
        background: $yellow;
    }

    &.show {
        right: 1rem;
    }

    &__close {
        position: absolute;
        right: 0;
        top: 0.5rem;
    }
}

.main {
    padding-top: 173px;
}

.owl {
    &-arrow {
        background: none;
        border: none;
        outline: none;

        &:hover {
            outline: none;
            background: none;
            border: none;
        }

        svg {
            transition: $durationM;
        }

        &:active {
            svg {
                transform: scale(0.8);
            }
        }

        &:focus {
            outline: none;
        }

        &-container {
            display: flex;
            justify-content: flex-end;
            margin-top: -210px;
            position: relative;
            max-width: 100px;
            z-index: 3;
            margin-left: auto;
        }
    }

    &-prev {
        transform: rotate(90deg) translate(-38px, -15px);

        svg {
            width: 30px;
            height: 30px;
        }

        svg path {
            fill: $grey-3;
        }
    }

    &-next {
        transform: rotate(-90deg);

        svg {
            width: 59px;
            height: 59px;
        }

        svg path {
            fill: $yellow-dark;
        }
    }
}

.hero {

    &__yellow-splash,
    &__xd,
    &__cut {
        width: 100%;
        height: 100%;
        position: absolute;
        bottom: 0;
        left: 0;
        background: url('../images/MainImg.svg');
        background-size: contain;
        background-position: center bottom;
        background-repeat: no-repeat;
    }

    &__xd {
        // transform: rotate(30deg);
        background: url('../images/mainXD.svg');
        background-size: contain;
        background-repeat: no-repeat;
        background-position: bottom;
        transform: scale(1.2) rotate(-6.9deg) translateY(-83px) translateX(18px);
        z-index: 1;
        max-height: 100vh;
    }

    &__cut {
        // transform: rotate(30deg);
        background: url('../images/threeFourCutMainImg.svg');
        background-size: contain;
        background-repeat: no-repeat;
        background-position: bottom left;
        z-index: 1;
        height: 102%;
        width: calc(100% + 30px);
        margin-left: -15px;
        margin-right: -15px;
        transform: translateY(1px);

        &::after {
            position: absolute;
            background: white;
            bottom: -50px;
            left: 0;
            content: '';
            z-index: 1;
            height: 50px;
            width: 100%;
        }
    }




    &__carousel {
        position: relative;
    }

    &__img {
        margin-bottom: -20px;
        display: initial !important;
        width: initial !important;
        max-height: 100vh;
        position: relative;
        min-height: 350px;

        &-carousel {
            &-link {
                position: absolute;
                top: 10%;
                right: 10%;
                box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.25);
                border-radius: 1.25rem;
                padding: 1rem 1.5rem;
                z-index: 5;
                display: block;
                background: white;

                svg path {
                    transition: $durationM;
                }

                &:hover {
                    transform: scale(1.1);

                    svg path {
                        fill: $yellow-dark;
                    }
                }

                &:active {
                    transform: scale(0.9);
                }

                &--2 {
                    top: 40%;
                    right: 60%;
                }

                &--3 {
                    top: 60%;
                    right: 5%;
                }
            }

            &-price {
                font-size: $fontSizeBodyL;
                font-weight: bold;

                &::before {
                    content: 'Ju≈º od';
                    display: block;
                    font-size: $fontSizeBodyXS;
                    margin-bottom: -6px;
                }
            }

            &-name {
                max-width: 180px;
            }
        }

    }

    &__text-carousel {

        &.owl-carousel,
        .owl-stage-outer,
        .owl-stage,
        .owl-item {
            height: 100%;
        }

        &.owl-carousel .owl-item {
            display: flex;
            justify-content: center;
        }
    }

    &__text-carousel-item {
        display: flex;
        flex-direction: column;
        place-items: flex-start;
        justify-content: center;
        max-width: 600px;
    }

    &__heading {
        font-weight: bold;
        font-size: $fontSizeH1;
    }

    &__subheading {
        font-size: $fontSizeBodyL;
        margin: 1rem 0 4rem 0;
    }
}

.products {
    position: relative;


    &--blue__splash,
    &--green__splash {
        z-index: -1;
    }

    &__carousel {
        max-width: 100%;
        margin: auto;
        border-radius: 1.25rem;
        padding: 2rem;
        border: 2px solid transparent;
        margin-top: -8px;
        background: white;
        //minus margin -top because of transparent here but borders on the blue and red containers

        .owl-stage {
            display: flex;
            flex: 1 0 auto;
            height: 100%;

        }

        .owl-item {
            display: flex;
            flex-direction: column;
            align-items: stretch;
        }
    }

    .owl-arrow-container {
        justify-content: center;
        margin: auto;
        margin-top: calc(50px - 2rem - 8px - 1rem - 4px);
    }

    .nav-pills {
        justify-content: center;
    }

    .nav-link {
        background: $grey-light;
        color: $dark;
        border: none;
        position: relative;
        overflow: hidden;
        border-radius: 200px;
        margin: 1rem;
        font-weight: bold;
        padding: 0.5rem 1.5rem;

        span {
            position: relative;
            z-index: 2;
        }

        &:hover,
        &:active,
        &:focus,
        &:not(:disabled):not(.disabled):active,
        &:not(:disabled):not(.disabled):focus,
        &:not(:disabled):not(.disabled):active:focus {
            background: $grey-light;
            color: $dark;
            border: none;
            box-shadow: none;
        }

        &:not(:disabled):not(.disabled):active {
            transform: scale(0.95);
        }

        &.active {

            background: $yellow-dark;
            color: black;

            &:hover,
            &:active,
            &:focus,
            &:not(:disabled):not(.disabled):active,
            &:not(:disabled):not(.disabled):focus,
            &:not(:disabled):not(.disabled):active:focus {
                background: $yellow-dark;
                color: $dark;
                border: none;
                box-shadow: none;
            }
        }
    }

    &__item-container {
        padding: 8px;
        border: 2px solid transparent;
        border-radius: 1rem;
        transition: $durationS;
        max-width: 320px;
        margin: auto;
        overflow-y: hidden;
        position: relative;
        height: 100%;

        &:hover {
            border-color: $yellow-dark;
        }
    }

    &__item {
        height: 100%;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
    }

    &__goto-product {
        &:hover {
            .products__click-info {
                top: 1.5rem;
            }
        }
    }

    &__extra {
        bottom: 0.75rem;
        left: 0.75rem;
        position: absolute;

        &-red {
            background: $green;
            color: white;

            &:hover {
                color: white;
                background: $green;
            }
        }

        &-yellow {
            background: $yellow;
            color: black;
        }
    }

    &__click-info {
        font-weight: bold;
        background: black;
        color: white;
        padding: 0.5rem 1rem;
        display: block;
        position: absolute;
        border-radius: 0.6rem;
        top: -5rem;
        font-size: 0.8rem;
        left: 50%;
        transform: translateX(-50%);
        text-align: center;
        width: calc(100% - 3rem);
        transition: $durationM;
        z-index: 2;
    }

    &__img-container {
        border: 1px solid $grey-light;
        border-radius: 1rem;
        padding: 1.5rem;
        position: relative;
        z-index: 1;
        display: flex;
        justify-content: center;
        align-items: center;

        &:hover {
            .products__img {

                &--second {
                    z-index: 3;
                    opacity: 1;
                }
            }
        }
    }

    &__img {
        max-width: 180px;
        max-height: 180px;
        height: 180px;
        margin: auto;
        object-fit: contain;


        &--second {
            position: absolute;
            width: 100%;
            height: 100%;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) scale(1.1);
            z-index: -1;
            opacity: 0;
            transition: $durationS;
        }
    }

    &__content {
        padding: 1rem 1rem;
        display: block;
    }

    &__category {
        font-size: $fontSizeBodyXS;
        color: $grey-2;

