            color: $dark;
        }

        &-old {
            margin: 0 0.5rem;
            font-size: $fontSizeBodyM;
            position: relative;
            margin-bottom: -5px;
            color: black;
        }
    }

    &__add {
        // margin-left: 1rem;
        min-width: 168px;

        svg {
            z-index: 2;
            position: relative;
        }
    }

    &--blue {
        .svg-container {
            position: relative;
        }

        &__splash {
            position: absolute;
            left: -25%;
            top: -12%;
            max-width: 100%;
        }

        .nav-link {
            &.active {

                background: $lightBlue;
                color: white;

                &:hover,
                &:active,
                &:focus,
                &:not(:disabled):not(.disabled):active,
                &:not(:disabled):not(.disabled):focus,
                &:not(:disabled):not(.disabled):active:focus {
                    background: $lightBlue;
                    color: white;
                }
            }
        }



        .tab-pane {
            .products {

                &__carousel {
                    border: 2px solid $lightBlue;
                    margin-top: 0;
                }

                &__item-container {
                    &:hover {
                        border-color: $lightBlue;
                    }

                    a:hover {
                        color: $lightBlue;
                    }
                }
            }

            a.products__add {
                background: $lightBlue;
                color: white;

                &::after,
                &::before {
                    content: '';
                }

                svg {
                    path {
                        fill: white;
                    }
                }

                &:hover {
                    background: $blue;

                    color: white;

                }
            }

            .toggle-favourite {
                svg path {
                    stroke: $lightBlue;
                }

                &.added svg path {
                    stroke: transparent;
                    fill: $lightBlue;
                }

                &:hover {
                    svg path {
                        fill: $lightBlue;
                    }
                }
            }

        }

        .owl-arrow-container {
            margin-top: 36px;
        }

        .owl-next svg path {
            fill: $lightBlue;
        }
    }


    &--green {

        &__splash {
            position: absolute;
            right: -25%;
            top: -12%;
            max-width: 100%;
        }

        .nav-link {
            &.active {

                background: $green;
                color: white;

                &:hover,
                &:active,
                &:focus,
                &:not(:disabled):not(.disabled):active,
                &:not(:disabled):not(.disabled):focus,
                &:not(:disabled):not(.disabled):active:focus {
                    background: $green;
                    color: white;
                }
            }
        }



        .tab-pane {
            .products {

                &__carousel {
                    border: 2px solid $green;
                    margin-top: 0;
                }

                &__item-container {
                    &:hover {
                        border-color: $green;
                    }

                    a:hover {
                        color: $green;
                    }
                }
            }

            a.products__add {
                background: $green;
                color: white;

                &::after,
                &::before {
                    content: '';
                }

                svg {
                    path {
                        fill: white;
                    }
                }

                &:hover {
                    color: white;
                    background: darken($color: $green, $amount: 10%);
                }
            }

            .toggle-favourite {
                svg path {
                    stroke: $green;
                }

                &.added svg path {
                    stroke: transparent;
                    fill: $green;
                }

                &:hover {
                    svg path {
                        fill: $green;
                    }
                }
            }

        }

        .owl-arrow-container {
            margin-top: 36px;
        }

        .owl-next svg path {
            fill: $green;
        }
    }
}

.toggle-favourite {
    padding: 0;
    transition: $durationS;

    svg {
        height: 36px;
        width: auto;

        path {
            transition: $durationS;
            fill: transparent;
            stroke: $yellow-dark;
        }
    }

    &:hover {
        svg path {
            fill: $yellow-dark;
            stroke: transparent;
        }
    }

    &.added {
        svg path {
            fill: $yellow-dark;
            stroke: transparent;
        }

        &:hover {

            transform: scale(1.2);
            // svg path {
            //     fill: white;
            //     stroke: $yellow-dark;
            // }
        }
    }

    &:active {
        transform: scale(0.8);
    }
}

