        }

        &__xd {
            transform: scale(1) rotate(-20.9deg) translateY(-90px) translateX(87px);
        }

        &__right {
            transform: translate(0);
            z-index: -1;
        }

        &__img {

            margin-bottom: -60px;
            max-height: 65vh;

            &-carousel {
                &-link {
                    display: none;
                }
            }
        }

        &__text-carousel {
            margin-top: -8rem;
            height: auto !important;

            &-item {
                padding-bottom: 2rem;
                margin-top: 0.5rem;
            }
        }


        .btn.btn-warning {
            margin-top: 1.5rem;
            transform: rotate(-2deg);
        }

        .owl-arrow-container {
            // margin-top: -18.5vh;
            // margin-left: auto;
            position: absolute;
            top: -110px;
            right: 8px;
            border-radius: 50%;

            .owl-prev {
                display: none;
            }

            .owl-next.hero__next {
                padding: 4px;
                border-radius: 50%;
                background: white;
            }
        }
    }

    .products {
        &__carousel {
            padding: 0;
            border: none;
            margin-right: -40px;

            .owl-stage {
                margin-left: -21px;

                &-outer {
                    margin-left: -40px;
                }
            }

            .grid-view {
                .card {
                    border: none;
                    border: none;
                }
            }
        }

        .nav-link {
            margin: 0.25rem;
        }

        &__img-container {
            background: white;
        }

        &__add {
            font-size: $fontSizeBodyXS !important;
        }

        .owl-arrow-container {
            margin-top: calc(50px - 1rem);
        }

        &--green,
        &--blue {
            .tab-pane .products {
                &__carousel {
                    border: none;
                }
            }

        }

        &--blue__splash {
            transform: rotate(40deg) translateX(-280px) translateY(-20%);
        }
    }

    .products--yellow {
        margin-top: 10vh !important;
    }

    .news,
    .instagram {
        position: relative;

        &__arrows {
            position: absolute;
            right: 0;
            top: 1.5rem;
        }
    }


    .newsletter {
        height: auto !important;
        margin-top: 1.5rem;

        &__decoration {
            top: 30%;
            height: 30%;

        }

        &__input {
            width: 100%;
            max-width: 100%;
        }

        &__submit {
            padding: 0;
            margin-left: 0;
            width: 100%;
            margin-top: 1rem;
        }

    }


    .partners,
    .newsletter {
        padding-bottom: 1.5rem;
    }

    .newsletter {
        margin-top: 3rem;
    }

    .help,
    .footer {
        margin-top: 1.5rem;
    }
}

@media (max-width:480px) {

    .news,
    .instagram {
        .owl-stage {
            margin-left: -80px;

            &-outer {
                margin-right: -40px;
            }
        }
    }
}

